    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE - col0 NOT IN ( 34 + + ( - col2 ) + col0 * col2 * - + col2 + - + col0, 11 );
  - name: tab2

outputs:
  - name: q3119.out
    data: |
      46	51	23
      64	77	40
      75	67	58
